class Order:
    def __init__(
        self, dish_name: str, quantity: int, special_instructions: Optional[str] = None
    ):
        self.id = str(uuid4())
        self.dish_name = dish_name
        self.quantity = quantity
        self.status = OrderStatus.PENDING
        self.special_instructions = special_instructions
        self.created_at = datetime.utcnow()

class OrderCreate(BaseModel):
    dish_name: str = Field(..., min_length=2, description="Name of the dish")
    quantity: int = Field(..., gt=0, description="Quantity of dishes ordered")
    special_instructions: Optional[str] = Field(None, max_length=500)
class OrderUpdate(BaseModel):
    status: OrderStatus
    special_instructions: Optional[str] = Field(None, max_length=500)
class OrderResponse(BaseModel):
    id: str
    dish_name: str

class OrderService:
    def __init__(self):
        self.orders: dict[str, Order] = {}
    def create_order(self, order_data: OrderCreate) -> Order:
        order = Order(
            dish_name=order_data.dish_name,
            quantity=order_data.quantity,
            special_instructions=order_data.special_instructions,
        )
        self.orders[order.id] = order

